using AlphaMDHealth.ClientBusinessLayer;
using AlphaMDHealth.Utility;

namespace AlphaMDHealth.MobileClient;

public class WebViewControlDemoPage : BasePage
{
    private readonly AmhWebViewControls _textWebViewControl;
    private readonly AmhWebViewControls _urlPageWebViewControl;
    private readonly AmhWebViewControls _imageWebViewControl;
    private readonly AmhWebViewControls _htmlWebViewControl;
    private readonly AmhWebViewControls _youTubeVideoWebViewControl;
    private readonly AmhWebViewControls _videoWebViewControl;
    //private readonly AmhWebViewControl _pdfWebViewControl;

    public WebViewControlDemoPage() : base(PageLayoutType.LoginFlowPageLayout, true)
    {
        SetPageLayoutOption(new OnIdiom<LayoutOptions> { Phone = LayoutOptions.FillAndExpand, Tablet = LayoutOptions.CenterAndExpand }, false);

        _imageWebViewControl = new AmhWebViewControls(FieldTypes.ImageWebviewControl)
        {
            ResourceKey = ResourceConstants.R_USER_NAME_KEY,
            Icon = ImageConstants.I_Demo_PNG,
        };
        AddView(_imageWebViewControl);

        _urlPageWebViewControl = new AmhWebViewControls(FieldTypes.UrlPageWebViewControl);
        AddView(_urlPageWebViewControl);

        _htmlWebViewControl = new AmhWebViewControls(FieldTypes.HtmlWebviewControl);
        AddView(_htmlWebViewControl);

        _youTubeVideoWebViewControl = new AmhWebViewControls(FieldTypes.YoutubeUrlWebviewControl);
        AddView(_youTubeVideoWebViewControl);

        _videoWebViewControl = new AmhWebViewControls(FieldTypes.UrlWebviewControl);
        AddView(_videoWebViewControl);

        _textWebViewControl = new AmhWebViewControls(FieldTypes.TextWebviewControl);
        AddView(_textWebViewControl);
    }

    protected override async void OnAppearing()
    {
        base.OnAppearing();
        await new AuthService(App._essentials).GetAccountDataAsync(PageData).ConfigureAwait(true);

        _imageWebViewControl.Value = "data:image/jpeg;base64,";
        _urlPageWebViewControl.Value = "https://www.wikipedia.org/";
        _htmlWebViewControl.Value = "<html>\r\n<body>\r\n\r\n<h1>The template Element</h1>\r\n\r\n<p>Click the button below to display the hidden content from the template element.</p>\r\n\r\n<button onclick=\"showContent()\">Show hidden content</button>\r\n\r\n<template>\r\n  <h2>Image</h2>\r\n  <img src=\"https://picsum.photos/seed/picsum/200/300\" width =\"214\" height=\"204\">\r\n</template>\r\n\r\n<script>\r\nfunction showContent() {\r\n  let temp = document.getElementsByTagName(\"template\")[0];\r\n  let clon = temp.content.cloneNode(true);\r\n  document.body.appendChild(clon);\r\n}\r\n</script>\r\n\r\n</body>\r\n</html>";
        _videoWebViewControl.Value = "https://ia800201.us.archive.org/12/items/BigBuckBunny_328/BigBuckBunny_512kb.mp4";
        _youTubeVideoWebViewControl.Value = "https://youtu.be/juJvl5UicIQ?si=GcB5c40PIyIZ1DLT";
        _textWebViewControl.Value = "this is my my simple text data to load in web view";
        AppHelper.ShowBusyIndicator = false;
    }

    protected override void OnDisappearing()
    {
        base.OnDisappearing();
        //Call Dispose method of web view control
        _videoWebViewControl.UnloadUIAsync();
        _youTubeVideoWebViewControl.UnloadUIAsync();
    }


    private void AddView(View view)
    {
        AddRowColumnDefinition(new GridLength(1, GridUnitType.Auto), 1, true);
        int index = PageLayout.Children?.Count() ?? 0;
        PageLayout.Add(view, 0, index);
    }
}